import Expenses from "./components/Expenses/Expenses";

function App() {
  const expenses = [
    { date: new Date(2020, 7, 14), title: "Car Insurance", amount: 297.5 },
    { date: new Date(2020, 8, 19), title: "New Tv", amount: 183.75 },
    { date: new Date(2021, 10, 28), title: "Travel", amount: 584.83 },
    { date: new Date(2021, 12, 3), title: "Medical", amount: 52.36 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>

      <Expenses expenses={expenses} />
    </div>
  );
}

export default App;
